query GetAllCoinIdsForCount($first: Int = 1000, $skip: Int = 0) {
  coinCreateds(
    first: $first
    skip: $skip
    orderBy: blockTimestamp
    orderDirection: asc
  ) {
    id
  }
}

6b12642e454c695e880223787c6a301a7156469e:
query GetCallerInfo($callerId: ID!) {
  caller(id: $callerId) {
    id
    coinsCreated(first: 10, orderBy: blockTimestamp, orderDirection: desc) {
      id
      name
      symbol
      coin
      blockTimestamp
    }
    blockNumber
    blockTimestamp
    transactionHash
  }
}

99cab0b17613d51cfe738022a043dffa045ccf40:
query GetCoinCreationTimeSeries($startTime: BigInt, $first: Int = 1000) {
  coinCreateds(
    first: $first
    orderBy: blockTimestamp
    orderDirection: asc
    where: {blockTimestamp_gte: $startTime}
  ) {
    id
    blockTimestamp
  }
}

0bd3d3de26305eb3942620fe2a7ccd22f7290b60:
query GetCoinsCreatedInTimeRange($startTime: BigInt!) {
  coinCreateds(
    where: {blockTimestamp_gte: $startTime}
    orderBy: blockTimestamp
    orderDirection: desc
    first: 1000
  ) {
    id
  }
}

93409d0f8cb1ee588f0d93cc0c9288b90ba33014:
query GetDailyCoinCreationStats {
  coinCreateds(orderBy: blockTimestamp, orderDirection: desc, first: 10) {
    id
    blockTimestamp
    name
    symbol
    coin
    uri
  }
}

4691ddc2e5391462ece9fe5643945f150c1a7c52:
query GetRecentCoinCreateds($first: Int = 5) {
  coinCreateds(first: $first, orderBy: blockTimestamp, orderDirection: desc) {
    id
    name
    symbol
    coin
    uri
    currency
    caller {
      id
    }
    blockTimestamp
    pool
    payoutRecipient
    platformReferrer
  }
}

